import React, { useState, useEffect } from "react";
import axios from "axios";
import "../styles/AdminDashboard.css";

const AdminDashboard = () => {
  const [currentView, setCurrentView] = useState("addUser");
  const [users, setUsers] = useState([]);
  const [items, setItems] = useState([]);
  const [newUser, setNewUser] = useState({
    firstname: "",
    lastname: "",
    email: "",
    password: "",
    userType: "student",
  });
  const [filterType, setFilterType] = useState("All"); // For Lost/Found filter
  const [filterCategory, setFilterCategory] = useState("All");

  // Fetch users
  useEffect(() => {
    if (currentView === "registeredUsers") fetchUsers();
    if (currentView === "lostItems" || currentView === "foundItems") fetchItems();
  }, [currentView]);

  // Fetch all users
  const fetchUsers = async () => {
    try {
      const token = localStorage.getItem("authToken");
      const response = await axios.get("http://localhost:5000/api/users/all-users", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUsers(response.data);
    } catch {
      alert("Failed to fetch users.");
    }
  };

  // Fetch all items (Lost/Found)
  const fetchItems = async () => {
    try {
      const token = localStorage.getItem("authToken");
      const response = await axios.get("http://localhost:5000/api/items", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setItems(response.data);
    } catch {
      alert("Failed to fetch items.");
    }
  };

  // Filtered items based on current view (Lost/Found) and category
  const filteredItems = items.filter((item) => {
    const matchesType =
      filterType === "All" ||
      (currentView === "lostItems" && item.postType === "Lost") ||
      (currentView === "foundItems" && item.postType === "Found");
    const matchesCategory = filterCategory === "All" || item.category === filterCategory;
    return matchesType && matchesCategory;
  });

  const renderContent = () => {
    switch (currentView) {
      case "addUser":
        return (
          <div className="add-user-form">
            <h2>Add New User</h2>
            <input
              type="text"
              placeholder="First Name"
              value={newUser.firstname}
              onChange={(e) => setNewUser({ ...newUser, firstname: e.target.value })}
            />
            <input
              type="text"
              placeholder="Last Name"
              value={newUser.lastname}
              onChange={(e) => setNewUser({ ...newUser, lastname: e.target.value })}
            />
            <input
              type="email"
              placeholder="Email"
              value={newUser.email}
              onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
            />
            <input
              type="password"
              placeholder="Password"
              value={newUser.password}
              onChange={(e) => setNewUser({ ...newUser, password: e.target.value })}
            />
            <button>Add User</button>
          </div>
        );

      case "registeredUsers":
        return (
          <div className="registered-users">
            <h2>Registered Users</h2>
            <table>
              <thead>
                <tr>
                  <th>First Name</th>
                  <th>Last Name</th>
                  <th>Email</th>
                  <th>User Type</th>
                </tr>
              </thead>
              <tbody>
                {users.map((user) => (
                  <tr key={user._id}>
                    <td>{user.firstname}</td>
                    <td>{user.lastname}</td>
                    <td>{user.email}</td>
                    <td>{user.userType}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        );

      case "lostItems":
      case "foundItems":
        return (
          <div className="items-view">
            <h2>{currentView === "lostItems" ? "Lost Items" : "Found Items"}</h2>
            <div>
              <label>Filter by Category:</label>
              <select
                onChange={(e) => setFilterCategory(e.target.value)}
                value={filterCategory}
              >
                <option value="All">All Categories</option>
                <option value="Electronics">Electronics</option>
                <option value="Personal-item">Personal Items</option>
                <option value="ID">ID</option>
                <option value="Other">Other</option>
              </select>
            </div>
            <div className="items-feed">
              {filteredItems.length === 0 ? (
                <p>No items available.</p>
              ) : (
                filteredItems.map((item) => (
                  <div key={item._id} className="item-post">
                    <strong>{item.description}</strong>
                    <p>
                      <strong>Category:</strong> {item.category}
                    </p>
                    <p>
                      <strong>Type:</strong> {item.postType}
                    </p>
                    <img
                      src={`http://localhost:5000/uploads/${item.image}`}
                      alt="item"
                      style={{ width: "150px", height: "150px" }}
                    />
                  </div>
                ))
              )}
            </div>
          </div>
        );

      case "category":
        return <h2>Manage Categories</h2>;

      default:
        return <h2>Welcome to Admin Dashboard</h2>;
    }
  };

  return (
    <div className="admin-dashboard">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>Admin Menu</h2>
        <ul>
          <li onClick={() => setCurrentView("addUser")}>Add User</li>
          <li onClick={() => setCurrentView("registeredUsers")}>Registered Users</li>
          <li onClick={() => setCurrentView("lostItems")}>Lost Items</li>
          <li onClick={() => setCurrentView("foundItems")}>Found Items</li>
          <li onClick={() => setCurrentView("category")}>Category</li>
          <li>
            <a href="/logout">Logout</a>
          </li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="content">{renderContent()}</div>

      {/* Right Sidebar */}
      <div className="right-sidebar">
        <h3>Admin Info</h3>
        <ul>
          <li>Manage Users</li>
          <li>Check System Status</li>
          <li>View Reports</li>
        </ul>
      </div>
    </div>
  );
};

export default AdminDashboard;
